@EU_Commission I've filled the survey, I only want to add that I hope #FutureofEurope will not depend on the morons in the comments who have no idea how the EU or even links work.
We should get rid of bots &amp; trolls, there are too many of them here.
And more education please, many need it still.

@EU_Commission I foresee an army and threats to countries to comply and tow the line over immigration or we decrease their funding. 
I foresee people in Greece and Italy starving due to high unemployment and mass immigration...... 
.....Lastly, I foresee Britain out of this protection racket.
